import MenuCard from './MenuCard';
function Cards(props) {
    return (

        <Row xs={1} md={4} className="g-4">

            {
                props.menu.forEach((v) => {
                    <Col>
                        <Card>
                            <Card.Img variant="top" src={v.img} />
                            <Card.Body>
                                <Card.Title>{v.name}</Card.Title>
                                <Card.Text>
                                    {'$ ' + v.price}
                                </Card.Text>
                            </Card.Body>
                        </Card>
                    </Col>
                })
